[NEW RELEASE](https://github.com/one-covenant/grail/releases/tag/v0.0.11) IS OUT! 🚀

TL;DR: The same UIDs tried to get sneaky again! This time with even more creative tricks. But most of them got caught in this release. 😎

if you really have to look at the logs they are here for now but they're gonna be hosted on grail dns later on:
http://3.140.247.6:3000/d/feylg4lb0hbeoa/logs-good-for-debugging?orgId=1

Right now it's pretty basic but I'm working on making the logs more clear and searchable later on.

Guys now that we have logs! It'd be great if you can look into the logs for your uid and tell me which tests are failing and which GPU you're using. Follow a format like this:

GPU: A100-SXM4-80GB
**Inference Library**: {Huggingface, VLLM, Sglang, etc}
**Failed Test**: Hard/Soft Check Failure - {name of the failed check if applicable (for soft-checks there is no type for now}
**Extra Info**: {add some extra info if you think it helps me debug it faster, especially about code changes that you've done!}

You can look this up for your uid by searching `CHECK_FAILURE uid={your-uid}` in grafana: http://3.140.247.6:3000/goto/UKLw2PCHg?orgId=1

GIVE IT 20 Minutes before you do this since right now the logs have just started coming in.

Let me know when you end up restarting your miner! Logs are improved on grafana now you can search them using uid={you-uid}

Example:
https://grail-grafana.tplr.ai/?orgId=1&refresh=30s&var-app=All&var-level=All&var-hotkey=All&var-quick=.%2A&var-search=uid%3D253
